const initialState = {
  searchId: '',
  data: [],
};

export const dataReducer = (state = initialState, action) => {
  switch (action.type) {
    case 'GET_SEARCH_ID': 
      console.log(action)
      return {...state, searchId: action.payload};
    case 'GET_TICKETS_DATA':
      return {...state, data: action.payload};
    default:
      return state;
  }
}
